export const initialState = {
  todos: {
    item: "Learn about reducers",
    completed: false,
    id: 3892987589
  }
};

export const todoReducer = (state, action) => {
  switch (action.type) {
    case "ADD_TODO":
      return {
        ...state,
        todos: {
          item: "Hello",
          completed: false,
          id: Date.now()
        }
      };

    default:
      return state;
  }
};
